Function Set-WallPaper($Value) {
New-PSDrive -PSProvider Registry -Name HKU -Root HKEY_USERS
$x = Get-WmiObject win32_useraccount -Filter ("name = '"+($user.split('\')[1])+"' AND domain = '"+($user.split('\')[0])+"'")
Set-ItemProperty -path ('HKU:\'+($x.SID)+'\Control Panel\Desktop\') -name Wallpaper -value $value
 RUNDLL32.EXE USER32.DLL,SystemParametersInfo 20 0 ("c:\users\"+ $x.name + "\desktop\where_r_my_files.png")
}


